importScripts("../../../lib/js/lodash.min.js","../../../lib/js/levenshtein.js","../algorithms/LevenshteinDistance.js","../algorithms/SequenceSorting.js");
onmessage=function(a){var c=a.data.algorithm,b=a.data.protein;a=new SequenceSorting(a.data.family);switch(c){case "editDistance":a.calculateEditDistanceScores(b).then(function(a){postMessage({algorithm:"edit_distance",score:a})});break;case "weightedEditDistance":a.calculateEditDistanceScores(b,{insertion:3,deletion:3,substitution:5}).then(function(a){postMessage({algorithm:"weighted_edit_distance",score:a})});break;case "commonality":a.calculateCommonalityScores(b).then(function(a){postMessage({algorithm:"commonality_scores",
score:a})});break;case "normalizedCommonality":a.calculateCommonalityScores(b,1).then(function(a){postMessage({algorithm:"normalized_commonality_scores",score:a})})}};
